let savedPollingRate;
let savedDpi1;
let savedDpi2;
let savedDpi3;
let savedDpi4;
let savedDpi5;
let savedDpi6;
let savedDpi7;

let pollingDict = {
	"125Hz" : 8,
	"250Hz" : 4,
	"500Hz" : 2,
	"1000Hz": 1
};
let vLedNames = [
	"Scroll Wheel", "Logo Area"

];
let vLedPositions = [
	[1, 0],
	[1, 2],
];

let vKeymap = [
	0, 1
];

